function p = propstoadd(this)
%PROPSTOADD   

%   Author(s): J. Schickler
%   Copyright 1988-2003 The MathWorks, Inc.

p = {...
  'ResponseType',...
  'NormalizedFrequency',...
  'Fs',...
  'FilterOrder',...
  'FilterType',...
  'TransitionWidth',...
  'Wcutoff',...
  'NumOrder',...
  'DenOrder',...
  'F3dB',...
  'F3dB1',...
  'F3dB2',...
  'BWpass',...
  'BWstop',...
  'Fcutoff',...
  'Fcutoff1',...
  'Fcutoff2',...
  'Wpass',...
  'Wstop',...
  'Fstop1',...
  'Fpass1',...
  'Fpass2',...
  'Fpass',...
  'Fstop',...
  'Fstop2',...
  'Astop1',...
  'Apass',...
  'Astop2',...
  'Apass1',...
  'Astop',...
  'Apass2'}';

% Find the fields that are present 
fn = fieldnames(this);
inds = cellfun(@(x) find(strcmp(x,p)),fn,'UniformOutput',false);

% Remove the fields from p that aren't present in fn
p = p(sort(cell2mat(inds)));

% Remove the ResponseType
p(strcmp(p,'ResponseType')) = [];

% [EOF]
